def reformatiraj_mapu(mapa,season):
    novamapa = {}
    #novamapa = {"JANUARY":{},"FEBRUARY":{},"MARCH":{},"APRIL":{},"MAY":{},"JUNE":{},"JULY":{},"AUGUST":{},"SEPTEMBER":{},"OCTOBER":{},"NOVEMBER":{},"DECEMBER":{}}
