def pretvori(mjesec):
    if mjesec==1:
        return "JANUARY"
    elif mjesec==2:
        return "FEBRUARY"
    elif mjesec==3:
        return "MARCH"
    elif mjesec==4:
        return "APRIL"
    elif mjesec==5:
        return "MAY"
    elif mjesec==6:
        return "JUNE"
    elif mjesec==7:
        return "JULY"
    elif mjesec==8:
        return "AUGUST"
    elif mjesec==9:
        return "SEPTEMBER"
    elif mjesec==10:
        return "OCTOBER"
    elif mjesec==11:
        return "NOVEMBER"
    else:
        return "DECEMBER"

def difference(dataset, interval=1):
	diff = list()
	for i in range(interval, len(dataset)):
		if i-interval != 0:
			value = float(dataset[i]) - float(dataset[i - interval])
			diff.append(value)
	return numpy.array(diff)

# invert differenced value
def inverse_difference(history, yhat, interval=1):
	return float(yhat) + float(history[-interval])

def find_duration(dat1, dat2):
    date1 = datetime.strptime(dat1, '%d.%m.%Y').date()
    date2 = datetime.strptime(dat2, '%d.%m.%Y').date()
    return abs((date2 - date1).days)+1




